import { configureStore } from '@reduxjs/toolkit';
import {numOfQuestionReducer, currentNumReducer} from '../components/slices/currentNum_Slice';

export const store = configureStore({
  reducer: {
    numOfQuestion:numOfQuestionReducer,
  },
});
